#include <cstdio>
#include <iostream>
#include <numeric>
#include <unordered_map>
#include <unordered_set>
#include <vector>

using namespace std;

class Solution {
   private:
    unordered_set<int> findDivisors(int n) {
        // numbers below 6 cant have 4 divisors
        if (n < 6) {
            return {};
        }

        unordered_set<int> divisors;
        for (int i = 1; i <= (n / 2); i++) {
            if ((n % i) == 0) {
                int quotient = n / i;

                // perfect squares will never have 4 divisors
                if (quotient == i) {
                    return {};
                }

                divisors.insert(i);
                divisors.insert(quotient);
            }

            // factors of numbers having more than 4 divisors are not needed
            if (divisors.size() > 4) {
                return {};
            }
        }

        return divisors;
    }

   public:
    int sumFourDivisors(vector<int>& nums) {
        int sum = 0;
        unordered_map<int, int> numsWith4DivsFactsSum;

        for (int i = 0; i < nums.size(); i++) {
            int crrEle = nums[i];
            int crrEleDivsSum = 0;

            if (numsWith4DivsFactsSum.find(crrEle) != numsWith4DivsFactsSum.end()) {
                // already calculated earlier
                crrEleDivsSum = numsWith4DivsFactsSum[crrEle];
            } else {
                unordered_set<int> divisors = findDivisors(crrEle);
                if (divisors.size() == 4) {
                    crrEleDivsSum = accumulate(divisors.begin(), divisors.end(), 0);
                    numsWith4DivsFactsSum[crrEle] = crrEleDivsSum;
                }
            }

            sum += crrEleDivsSum;
        }

        return sum;
    }
};
